ell_type":"code","source":"recipe_tree <- recipe(log_calories ~ ., data = train) %>%\n  step_rm(id, Calories, yj_calories) %>%\n\n  # Feature engineering\n  step_mutate(\n    BMI = Weight / (Height / 100)^2,\n    Temp_Deviation = Body_Temp - 37,\n    HR_per_min = Heart_Rate / Duration,\n    Temp_per_min = Body_Temp / Duration\n  ) %>%\n\n  # Clean and transform engineered features\n  step_mutate(\n    BMI = pmax(BMI, 0),\n    log_HR_per_min = log1p(HR_per_min),\n    log_Temp_per_min = log1p(Temp_per_min)\n  ) %>%\n  step_rm(HR_per_min, Temp_per_min) %>%\n\n#step_interact(Duration:Weight) %>%\n  step_mutate(\n      log_HR_per_min = pmin(log_HR_per_min, quantile(log_HR_per_min, 0.99)),\n      BMI = pmin(BMI, quantile(BMI, 0.99))\n    ) %>%\n  # Bin age into  4 life stages (custom cut)\n  step_mutate(\n    age_group = factor(case_when(\n      Age <= 25 ~ \"young\",\n      Age <= 45 ~ \"adult\",\n      Age <= 65 ~ \"midlife\",\n      TRUE      ~ \"senior\"\n    ))\n  ) %>%\n  step_ns(Age, deg_free = 4) %>%\n\n  # One-hot encode categorical variables\n  step_dummy(all_nominal_predictors()) \n\n\n\n\n\nrecipe_tree %>% prep %>% juice %>% head\nrecipe_tree %>% prep %>% juice %>% plot_histogram(., position=\"identity\", alpha=0.5)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-02T17:52:24.082315Z","iopub.execute_input":"2025-05-02T17:52:24.083715Z","iopub.status.idle":"2025-05-02T17:52:25.959169Z","shell.execute_reply":"2025-05-02T17:52:25.957212Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 18</caption>\n<thead>\n\t<tr><th scope=col>Height</th><th scope=col>Weight</th><th scope=col>Duration</th><th scope=col>Heart_Rate</th><th scope=col>Body_Temp</th><th scope=col>log_calories</th><th scope=col>BMI</th><th scope=col>Temp_Deviation</th><th scope=col>log_HR_per_min</th><th scope=col>log_Temp_per_min</th><th scope=col>Age_ns_1</th><th scope=col>Age_ns_2</th><th scope=col>Age_ns_3</th