_workflow <- workflow() %>%\n  add_model(xgb_spec) %>%\n  add_recipe(recipe_tree)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-02T17:52:26.461643Z","iopub.execute_input":"2025-05-02T17:52:26.463162Z","iopub.status.idle":"2025-05-02T17:52:26.484868Z","shell.execute_reply":"2025-05-02T17:52:26.483131Z"}},"outputs":[],"execution_count":25},{"cell_type":"markdown","source":"## Create optimization grid","metadata":{}},{"cell_type":"code","source":"prep_tree <- prep(recipe_tree, training = train)\njuice_tree <- juice(prep_tree)\nn_pred <- ncol(juice_tree) - 1\n\n# Random Forest grid\nrf_grid <- grid_latin_hypercube(\n  mtry(range = c(1L, as.integer(n_pred))),\n  min_n(),\n  size = 10\n)\n\n# XGBoost grid\nxgb_grid <- grid_latin_hypercube(\n  tree_depth(),\n  learn_rate(),\n  size = 10\n)\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-02T17:52:26.487464Z","iopub.execute_input":"2025-05-02T17:52:26.488807Z","iopub.status.idle":"2025-05-02T17:52:26.668336Z","shell.execute_reply":"2025-05-02T17:52:26.666518Z"}},"outputs":[],"execution_count":26},{"cell_type":"markdown","source":"## Create Workflows","metadata":{}},{"cell_type":"code","source":"set.seed(42)\n\nfolds <- vfold_cv(train, v = 5)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-02T17:56:00.341311Z","iopub.execute_input":"2025-05-02T17:56:00.34306Z","iopub.status.idle":"2025-05-02T17:56:00.364416Z","shell.execute_reply":"2025-05-02T17:56:00.362641Z"}},"outputs":[],"execution_count":28},{"cell_type":"code","source":"rf_results <- tune_grid(\n  rf_workflow,\n  resamples = folds,\n  grid = rf_grid,\n  metrics = metric_set(rmse),\n  control = control_grid(save_workflow = TRUE)\n)\n\n\n\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-02T17:56:01.309479Z","iopub.execute_input":"2025-05-02T17:56:01.311148Z"}},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# Tune XGB\nxgb_results <- tune_grid(\n  xgb_workflow,\n  resamples = folds,\n  grid = xgb_grid,\n  metrics = metric_set(rmse),\n  control = control_grid(save_workflow = TRUE)\n)","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# Fit Linear Regressionlm_results <- fit_resamples(\n  lm_workflow,\n  resamples = folds,\n  metrics = metric_set(rmse),\n  control = control_grid(save_workflow = TRUE)\n)\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### Tune all workflows with Cross Validation\n\nK-Fold Cross-Validation should be fine for this dataset, as there is no bias in the distribution of any of the variables.","metadata":{}},{"cell_type":"code","source":"## Tune Random Forest\n#rf_res <- tune_grid(\n#  rf_workflow,\n#  resamples = folds,\n#  grid = 10,\n#  metrics = metric_set(rmse)\n#)\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### COmpare performances","metadata":{}},{"cell_type":"code","source":"all_metrics <- bind_rows(\n  collect_metrics(rf_results) %>% mutate(model = \"Random Forest\"),\n  collect_metrics(xgb_results) %>% mutate(model = \"XGBoost\"),\n  collect_metrics(lm_results) %>% mutate(model = \"Linear Regression\")\n)\n\nall_metrics %>%\n  filter(.metric == \"rmse\") %>%\n  arrange(mean)","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"# XGBoost tuning plot\nautoplot(xgb_results)\n\n# Random Forest tuning plot\nautoplot(rf_results)\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### Select best workflow\n\nWe select the best workflow for each approach. We then ensemble them together.","metadata":{}},{"cell_type":"code","source":"# Finalize XGBoost\nbest_xgb <- select_best(xgb_results, metric= \"rmse\")\nwf_xgb <- finalize_workflow(xgb_workflow, best_xgb)\nfit_xgb <- fit(wf_xgb, data = train)\n\n# Finalize Random Forest\nbest_rf <- select_best(rf_results, metric=\"rmse\")\nwf_rf <- finalize_workflow(rf_workflow, best_rf)\nfit_rf <- fit(wf_rf, data = train)\n\n# Fit linear model (no tuning)\nfit_lm <- fit(lm_workflow, data = train)\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### Make Predictions\n\nRemember to transform Calories back, after log transforming it.","metadata":{}},{"cell_type":"code","source":"test <- test %>%\n  mutate(\n    Calories = NA,           # needed only to pass recipe validation\n    log_calories = NA  ,\n    yj_calories = NA\n  )\n\npred_xgb <- predict(fit_xgb, new_data = test)\npred_rf  <- predict(fit_rf, new_data = test)\npred_lm  <- predict(fit_lm, new_data = test)\n\npred_xgb <- mutate(pred_xgb, .pred = expm1(.pred))\npred_rf  <- mutate(pred_rf,  .pred = expm1(.pred))\npred_lm  <- mutate(pred_lm,  .pred = expm1(.pred))\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### Average Predictions\n\nWe can use an average weight, if one model performs better than the others.","metadata":{}},{"cell_type":"code","source":"ensemble_pred <- (pred_xgb$.pred + pred_rf$.pred + pred_lm$.pred) / 3\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"markdown","source":"### Create Submission file","metadata":{}},{"cell_type":"code","source":"submission <- tibble(\n  id = test$id,\n  Calories = ensemble_pred\n)\n\nwrite_csv(submission, \"submission.csv\")\n","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"submission","metadata":{"trusted":true},"outputs":[],"execution_count":null},{"cell_type":"code","source":"","metadata":{"trusted":true},"outputs":[],"execution_count":null}]}